     task.short_description = 'Requestor Validation' + ' - ' + current.short_description;
task.state = 1;
task.assigned_to = getAssignedTo();

function getAssignedTo() {
	var gr = new GlideRecord('x_noahr_nah_bi_task');
	gr.addQuery('bi_request', current.sys_id);
	gr.query();
	if (gr.getRowCount() > 0){
		if (gr.next())
			return gr.assigned_to;
	}
	else
		gs.error('-----> error in nah bi workflow no rows returned when setting the assigned to on the requestor validation task {0}', current.number);
}

